  return (
    <Container>
    <Row>
      <Col><img class="frontity-lazy-image" loading="lazy" src="https://globalgoalscms.co.uk/wp-content/uploads/2021/09/14-title.svg"/></Col>
    </Row>
  </Container>
  )
}
